import React from 'react';
import { ListGroup, ListGroupItem } from './styles';

const UsersList = ({ users }) => (
  <ListGroup>
    {users.map((user) => <ListGroupItem key={user.id}>{user.first_name}</ListGroupItem>)}
  </ListGroup>
);

export default UsersList;
